import React from 'react';
import './ServicesPage.css';
import { useNavigate } from 'react-router-dom';


const ServicesPage = () => {
    const navigate = useNavigate(); // Use navigate to programmatically navigate

// Example data, you can replace this with dynamic data fetching
const services = [
    {
    id: 1,
    title: 'TLV Food Catering',
    rating: 4.9,
    reviews: 159,
    image: '/catering.jpeg',
    },
    {
    id: 2,
    title: 'Moshe Photography',
    rating: 4.8,
    reviews: 35,
    image: '/cover-profile.webp',
    },
    {
    id: 3,
    title: 'Aviv DJ',
    rating: 4.7,
    reviews: 48,
    image: '/dj.jpg',
    },
];

const handleMoreInfoClick = (id) => {
    navigate(`/profile/${id}`);
};

return (
    <div className="services-page-container">
    <div className="services-grid">
        {services.map((service) => (
        <div className="service-card" key={service.id}>
            <img src={service.image} alt={service.title} className="service-image" />
            <div className="service-info">
            <h3>{service.title}</h3>
            <p>({service.reviews} Reviews) {service.rating} <span className="stars">★★★★</span></p>
            <button 
                className="info-button"
                onClick={() => handleMoreInfoClick(service.id)}
            >+ INFO</button>
            </div>
        </div>
        ))}
    </div>
    <div className="sidebar">
        <h4>Category</h4>
        {/* Add your filter inputs here */}
        <h4>Location</h4>
        {/* Add your filter inputs here */}
        <h4>Review</h4>
        {/* Add your filter inputs here */}
        <button className="search-button">חיפוש</button>
    </div>
    </div>
);
};

export default ServicesPage;
